          description: 'End date and time value of the date range to search the transaction records. <br> Format: yyyy-MM-ddTHH:mm:ss.SSS <br>'
          format: date-time
    CurAmtRangeType:
      title: CurAmtRangeType
      type: object
      properties:
        LowCurAmt:
          $ref: '#/components/schemas/LowCurAmtType'
        HighCurAmt:
          $ref: '#/components/schemas/HighCurAmtType'
      description: Details of the amount range that contains the low currency and high currency amount to return the transaction records.
    ChkNumRangeType:
      title: ChkNumRangeType
      type: object
      properties:
        ChkNumStart:
          maxLength: 22
          type: string
          description: |-
            Starting check number value to retrieve transaction records based on Check Number range.<br>
            <blockquote>Note: If only start check number is provided, then the transactions with check number equal/higher are considered to search transaction record.</blockquote>
        ChkNumEnd:
          maxLength: 22
          type: string
          description: |-
            Ending check number value to retrieve transaction records based on Check Number range.<br>
            <blockquote>Note: If only end check number is provided, then the transactions with check number equal/lower are considered to search transaction record.</blockquote>
      description: 'Details of the check range that contains the start check number (ChkNumStart) and the end check number (ChkNumEnd) information to consider the check records to search transaction record. <br> <blockquote>Note: If the start check number and the end check number range is provided, then the transactions within the check number range are considered to search transaction record. </blockquote>'
    TrnCodeRangeType:
      title: TrnCodeRangeType
      type: object
      properties:
        TrnCodeStart:
          maxLength: 80
          type: string
          description: Starting transaction code to retrieve transaction records based on transaction code range.
        TrnCodeEnd:
          maxLength: 80
          type: string
          description: Ending transaction code to retrieve transaction records based on transaction code range.
      description: Details of the transaction code range that contains the start transaction code and the end transaction code information to return the transaction records.
    TrnPostTypeType:
      title: TrnPostTypeType
      type: string
      description: |-
        Type of posted transaction. <br>Valid values are:
          - MemoPostOnly
          - ExcludeMemoPost
          - All
      enum:
      - MemoPostOnly
      - ExcludeMemoPost
      - All
    SortCriterionTypeType:
      title: SortCriterionTypeType
      type: string
      description: |-
        Criterion to sort the transaction records. For example, Precision sorts the transactions by the posted date. <br>Valid values are:
          - TrnCode
          - PostedDt
          - ChkNum
          - TrnAmt
      enum:
      - TrnNum
      - ChkNum
      - TrnIdent
      - TrnCode
      - PostedDt
      - EffDt
      - TrnAmt
      - TrnDesc
      - DisclosureIdent
      - DateTime
    SortOrderType:
      title: SortOrderType
      type: string
      description: Sort transactions either in an ascending or the descending order. For example, order transaction by the latest posted date or by the oldest posted date.
      enum:
      - Ascending
      - Descending
    SortType:
      title: SortType
      type: object
      properties:
        SortCriterionType:
          $ref: '#/components/schemas/SortCriterionTypeType'
        SortOrder:
          $ref: '#/components/schemas/SortOrderType'
    AcctTrnSelType:
      title: AcctTrnSelType
      type: object
      properties:
        AcctKeys:
          $ref: '#/components/schemas/AcctKeysType'
        DtRange:
          type: array
          description: |-
            Details of date range that contains the start date and the end date information to return the transaction records . <br>

            <blockquote>Note: To fetch the transactions for a specific number of days, use AcctTrnSel/PeriodType field.</blockquote>
          items:
            $ref: '#/components/schemas/DtRangeType'
        PeriodType:
          type: string
          description: |-
            Number of days to fetch the transactions. <br>Valid values are:
              - 15Days
              - 30Days
              - 60Days
              - 90Days
        CurAmtRange:
          $ref: '#/components/schemas/CurAmtRangeType'
        ChkNumRange:
          $ref: '#/components/schemas/ChkNumRangeType'
        TrnCodeRange:
          $ref: '#/components/schemas/TrnCodeRangeType'
        TrnPostType:
          $ref: '#/components/schemas/TrnPostTypeType'
        IncRunningBalanceInd:
          type: boolean
          description: Flag to indicate to show the resulting balance after each transaction.
        IncReversalTrnInd:
          type: boolean
          description: Flag to include reversed transactions. This indicates the reversed transactions are returned as part of transaction history records.
        Sort:
          type: array
          description: Sort .
          items:
            $ref: '#/components/schemas/SortType'
      description: Details of the sort criteria to arrange or classify the requested transaction records.
    AcctTrnInqRqType:
      title: AcctTrnInqRqType
      required:
      - AcctTrnSel
      type: object
      properties:
        RecCtrlIn:
          $ref: '#/components/schemas/RecCtrlInType'
        AcctTrnSel:
          $ref: '#/components/schemas/AcctTrnSelType'
    SeverityType:
      title: SeverityType
      type: string
      enum:
      - Error
      - Warning
      - Info
    SubjectElementType:
      title: SubjectElementType
      type: object
      properties:
        Path:
          type: string
          description: Path indicates which EFX element is in error. It provides either the path of the element, or just the element name. If it provides the path, it must use XPath absolute notation with the starting node being the node of the message, and ending with the name of the element in error.
        ServerPath:
          maxLength: 256
          type: string
          description: Server Path is the Service Provider’s identification of the field in their schema, such as an XPath, field ID, or field name that is associated with the ServerStatusCode. If this element is set, it must be returned in the ServerPath element of the OvrdExceptionData aggregate if the exception is being overridden.
        Value:
          maxLength: 256
          type: string
          description: Value string representation of the EFX data value of the element in error. This field is intended to provide a human readable visual hint as to the value in error. It should not be provided for fields that cannot be represented as a string (i.e., binary data).
    AdditionalStatusType:
      title: AdditionalStatusType
      type: object
      properties:
        StatusCode:
          maxLength: 20
          type: string
          description: EFX Standard Status code for the result of API response. Refer to the <a href="../docs?path=docs/response-codes.md">Response Codes</a> section to view the list of all possible status codes.
        StatusDesc:
          maxLength: 255
          type: string
          description: Brief information about the EFX status code. Refer to the <a href="../docs?path=docs/response-codes.md">Response Codes</a> for more information.
        Severity:
          $ref: '#/components/schemas/SeverityType'
        SvcProviderName:
          maxLength: 1024
          type: string
          description: Service Provider Name is a globally unique identifier for a service provider which indicates the location of the Service Provider that gave the error.
        ServerStatusCode:
          maxLength: 20
          type: string
          description: Server Status Code is used to indicate the Service Provider’s application status code that tells the consumer the result of the operation call.
        ServerStatusDesc:
          maxLength: 255
          type: string
          description: Server Status Description is the Service Provider’s explanatory text associated with the ServerStatusCode.
        OvrdExceptionInd:
          type: boolean
          description: Override Exception Indicator indicates whether the exception can be overridden by resubmitting the request message.
        SubjectElement:
          type: array
          description: Subject Element aggregate provides information about which elements caused the status. The aggregate is repeating to allow for a relationship between one or more elements if the combination causes the status code.
          items:
            $ref: '#/components/schemas/SubjectElementType'
    StatusType:
      title: StatusType
      required:
      - Severity
      - StatusCode
      - StatusDesc
      - SvcProviderName
      type: object
      properties:
        StatusCode:
          maxLength: 20
          type: string
          description: EFX Standard Status code for the result of API response. Refer to the <a href="../docs?path=docs/response-codes.md">Response Codes</a> section to view the list of all possible status codes.
        StatusDesc:
          maxLength: 255
          type: string
          description: EFX Standard Status code for the result of API response. Refer to the <a href="../docs?path=docs/response-codes.md">Response Codes</a> section for more information.
        Severity:
          $ref: '#/components/schemas/SeverityType'
        SvcProviderName:
          maxLength: 1024
          type: string
          description: Service Provider Name is a globally unique identifier for a service provider which indicates the location of the Service Provider that gave the error.
        ServerStatusCode:
          maxLength: 20
          type: string
          description: Server Status Code is used to indicate the Service Provider’s application status code that tells the consumer the result of the operation call.
        ServerStatusDesc:
          maxLength: 255
          type: string
          description: Server Status Description is the Service Provider’s explanatory text associated with the ServerStatusCode.
        OvrdExceptionInd:
          type: boolean
          description: Override Exception Indicator indicates whether the exception can be overridden by resubmitting the request message.
        SubjectRole:
          type: string
          description: Subject Role.
        SubjectElement:
          type: array
          description: Subject Element aggregate provides information about which elements caused the status. The aggregate is repeating to allow for a relationship between one or more elements if the combination causes the status code.
          items:
            $ref: '#/components/schemas/SubjectElementType'
        ContentHTML:
          type: string
          description: Content HTML. Use to provide HTML context to some status responses. In Premier, upon failure an HTML page is provided to support the maintenance of failures reported. The Content HTML may be availalble to a time interval which is established by the service provider.
