          type: array
          description: Additional Status aggregate may appear once for each additional status that the server intends to provide.
          items:
            $ref: '#/components/schemas/AdditionalStatusType'
      description: Details of the API response messages.
    RecCtrlOutType:
      title: RecCtrlOutType
      required:
      - SentRecCount
      type: object
      properties:
        SentRecCount:
          type: integer
          description: Total number of records that matched the selection criteria and are returned in the response message. <br>Total Number of Records = Number of posted transactions that completed the nightly processing + Number of memo posted transactions
          format: int64
        MatchedRecCount:
          type: integer
          description: Number of records that matches the requested selection criteria.
          format: int64
        Cursor:
          maxLength: 250
          type: string
          description: |-
            Next record pointer included in the response only if more than 250 posted transactions records exist. <br>

            <blockquote>Note: Premier returns a maximum of 250 posted transactions. If there are additional posted transactions, ESF will return Cursor value in this (RecCtrlOut/Cursor) field. This cursor value should be passed in the subsequent request within the RecCtrlIn/Cursor field to retrieve the next set of posted transactions. This feature is not applicable for memo post transactions.</blockquote>
      description: Details of the information required to retrieve additional records that matched the specified selection criteria. Applicable only when a client uses the RecCtrlIn aggregate field in the request.
